import React from 'react';
import data from '../data/logement.json'; // Assurez-vous que le chemin est correct
import '../sass/pages/home.scss'; // Importez le fichier SCSS

function Home() {
  return (
    <div className="home-container">
      {data.map(logement => (
        <div key={logement.id} className="logement-card">
          <img src={logement.cover} alt={logement.title} className="logement-image" />
          <h3 className="logement-title">{logement.title}</h3>
        </div>
      ))}
    </div>
  );
}

export default Home;
